import React from "react";
import "./css/PageAnime.css";
function PageAnime() {

    const animes = [{
        title: ""
    }]


  return (
    <div className="container p-4">
      <div className="card text-center">
        <img
          className="card-img-top img-url"
          alt=""
          src="https://wallpaperaccess.com/full/677430.jpg"
        />
        <div className="card-body">
          <h4 className="card-title">Naruto Shippuden</h4>
          <p className="card-text">
            Naruto quiere ser el mejor ninja en la tierra. La acción comienza
            tras los dos años y medio que el protagonista, Naruto Uzumaki, ha
            pasado entrenando con su maestro Jiraiya. En ella reaparecen todos
            los personajes de la serie anterior pero con más experiencia y
            fuerza. Además, la Organización Akatsuki entra en acción, tras su
            breve aparición en la parte anterior, y se revelan sus objetivos.
          </p>
        </div>
      </div>
    </div>
  );
}

export default PageAnime;
